import React from 'react';

type TransactionListProps = {
  transactions: {
    transaction_id: string;
    account_id: string;
    amount: number;
    created_at: string;
  }[];
  balance: number;
};

const TransactionList: React.FC<TransactionListProps> = ({ transactions, balance }) => {
  return (
    <div className='border border-secondary'>
      <h2>Transaction History</h2>
      <ul >
        {transactions.map((transaction) => (
          <li className='border border-secondary mb-1 py-5' key={transaction.transaction_id}>
            {transaction.amount} (Account: {transaction.account_id}) - {transaction.created_at}
          </li>
        ))}
      </ul>
      <h3>Current Balance: {balance}</h3>
    </div>
  );
};

export default TransactionList;
